export default function DataShowing() {
    const [users, setUser] = useState([])
    useEffect (() => {
        axios.get('http://localhost:3001/user')
        .then(userss=> setUser(userss.data))
        .catch (err=>console.log(err))
    },[])
  return (
    <div>
        <table>
            <thead>
                <tr>
                    <th>Id</th> 
                    <th>Title</th>
                    <th>Created_by</th>
                </tr>
            </thead>
            <tbody>
                {users.map(user=>{

                    return <tr>
                        <td>{user.Id}</td>
                        <td>{user.Name}</td>
                        <td>{user.Role}</td>
                    </tr>
                })}
            </tbody>
        </table>
    </div>

  )
}
